import Head from "next/head";
import Layout, { siteTitle } from "../components/layout";
import utilStyles from "../styles/utils.module.css";
import styles from "../components/layout.module.css";
const name = "Ila Sahu";
const space = " &nbsp";
export default function Home() {
  return (
    <Layout home>
      <Head>
        <title>{siteTitle}</title>
      </Head>

      <section className={utilStyles.headingMd}>
        <div className={styles.firstFold}>
          <>
            <div
              className={`${styles.column}  ${styles.floatRight} ${styles.width40}  ${styles.pt3} `}
            >
              <img
                src="/images/ila.png"
                className={`${styles.headerHomeImage} ${styles.positionAbsolute} ${utilStyles.borderCircle}`}
                alt={name}
              />
            </div>
            <div className={`${styles.column}  ${styles.width20}`}>&nbsp;</div>
            <div
              className={`${styles.column}  ${styles.width30} ${styles.textLeft} `}
            >
              <h1>Hey, I am Ila!</h1>
              <p className={` ${styles.headerMenu} ${styles.lineHeight0}`}>
                Software • Baking • Fitness • Meditation
              </p>
            </div>
          </>
        </div>
        <div className={`${styles.secondFold} ${styles.row}`}>
          <>
            <div className={`${styles.column}  ${styles.width20}`}>
              &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;
              &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;
              &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp;
              &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;
              &nbsp;&nbsp; &nbsp;
            </div>

            <div
              className={`${styles.column}   ${styles.width60} ${styles.textLeft} ${styles.pt3} `}
            >
              <h2>About</h2>
              <p className={` ${styles.lineHeight1} ${styles.desc}`}>
                I'm a Bangalore based software developer specialized in backend
                technologies. I've immense love for Fitness, lifting weights,
                yoga and swimming. I love baking cakes and cookies. Pets are my
                best friend.
              </p>
            </div>
          </>
        </div>
        <div className={styles.thirdFold}>
          <>
            <img
              src="/images/about.png"
              className={`${styles.headerHomeImage} ${styles.positionAbsolute} ${utilStyles.borderCircle}`}
              alt={name}
            />
          </>
        </div>
      </section>
    </Layout>
  );
}
